import smtplib
import uuid
from email.mime.multipart import MIMEMultipart
from email.mime.text import MIMEText
from email.header import Header
from email.utils import formatdate
from typing import List


def send_email(
    to_list: List[str],
    subject: str,
    html_text: str,
    sender_email: str,
    password: str,
    smtp_host: str = 'smtp.163.com',
    smtp_port: int = 465,
    cc_list: List[str] = [],
    bcc_list: List[str] = []
) -> str:
    # 手动构建 Message-ID（以 sender 域名为主）
    domain = sender_email.split("@")[-1]
    uid = uuid.uuid4().hex
    msg_id = f"<{uid}@{domain}>"

    # 构建邮件对象
    message = MIMEMultipart()
    message["From"] = sender_email
    if to_list:
        message["To"] = ", ".join(to_list)
    if cc_list:
        message["Cc"] = ", ".join(cc_list)
    message["Subject"] = Header(subject, 'utf-8')
    message["Message-ID"] = msg_id  # 手动设置 Message-ID
    message["Date"] = formatdate(localtime=True)

    message.attach(MIMEText(html_text, "html", "utf-8"))

    # 所有收件人 = To + Cc + Bcc
    all_recipients = to_list + cc_list + bcc_list

    if not all_recipients:
        return "❌ 错误：至少需要一个收件人（To / Cc / Bcc）"

    try:
        server = smtplib.SMTP_SSL(smtp_host, smtp_port)
        server.login(sender_email, password)
        server.sendmail(sender_email, all_recipients, message.as_string())
        server.quit()
        return f"✅ 邮件发送成功\nTo: {to_list}\nCc: {cc_list}\nBcc: {bcc_list}\nMessage-ID: {msg_id}"
    except Exception as e:
        return f"❌ 邮件发送失败：{str(e)}"


